def avg(numbers):
    return sum(numbers)*1.0/len(numbers) if len(numbers) else 0.0

def fold_score(param):
    
    (data, annotations, lc_data, foldnr) = param
    
#     print len(data), len(annotations), foldnr
    
    test = data[foldnr]
    test_annotations = annotations[foldnr]
    
    train = data[:foldnr] + data[foldnr+1:]
    train_annotations = annotations[:foldnr] + annotations[foldnr+1:]
    
    
#     print len(train), len(train_annotations)
#     print train[0][0]
    
    train = list(itertools.chain.from_iterable(train))
    train_annotations = list(itertools.chain.from_iterable(train_annotations))
    
    learner = svm.SVC(C=c_val, gamma=gamma_val, cache_size=500, probability=True)
    learner.fit(train, train_annotations)
    

    roc_score, lc_scores = roc_and_lc(test, test_annotations, lc_data, learner)
    return (roc_score, lc_scores)

#     score = learner.score(test, test_annotations)
#     return score


def roc_score(test_set, test_annotations, learner):
    
    probs = learner.predict_proba(test_set)
    fpr, tpr, _thresholds = metrics.roc_curve(test_annotations, probs[:,1])
    roc_auc = metrics.auc(fpr, tpr)
    
    return roc_auc



def roc_and_lc(test_set, test_annotations, lc_data, learner):
    
    probs = learner.predict_proba(test_set)
    fpr, tpr, _thresholds = metrics.roc_curve(test_annotations, probs[:,1])
    roc_auc = metrics.auc(fpr, tpr)
    
    
    lc_score_probs = learner.predict_proba(lc_data)
    
    lc_score_probs = list(lc_score_probs)
    
    lc_scores = [x[0] for x in lc_score_probs] # only need prob. for one class
    
    return roc_auc, lc_scores

def plot_bar(data, names):
    

    fig, ax = pyplot.subplots()
    width=0.4
    x_size = len(names)
    ax.bar(range(x_size), data, width=width)
    ax.set_xticks(numpy.arange(x_size) + width/2)
    ax.set_xticklabels(names, rotation=90)
    
    ax.set_yticks([0.1* x for x in range(11)])
    ax.set_ylabel("avg. classification score")

    pyplot.title("Average feature score")
    ax.set_ylim(0.5, 1)
    ax.set_xlim(-width, x_size)
    
    pyplot.grid(True, axis="y")
    pyplot.show()







def make_weights(score_list):
    
    return map(scale_to_0_1, score_list)
    

def scale_to_0_1(score):
    
    score = score - 0.5 if score > 0.5 else 0.0
    score = 2.0 * score
    
    return score
    

